Home made with 4 cups of Charlotte👩‍🍳 When my lil Chef Charlotte asked me for a birthday, I told her, “Mommy already made one for you.”
She told me, “that was Linda’s birthday! My birthday is in November.”
Wow, I realized at that moment my girls are each their own individuals. 
It was one of the hardest days as Walter was in the hospital 
but Shuie and I realized we both couldn’t be in 2 places at the same time. Picking this theme for her 4th birthday was so easy. Her love for cooking, and yummy smelling kitchen moments is a perfect way of explaining that she’s me! This day couldn’t have not been possible without all of you:
